import CardTemplate from "/components/cards";
import "./App.css";
import CarouselFadeExample from "/components/carousel";

function App() {
  return (
    <div className="App">
      <h1>DTNS News Blog</h1>

      <CarouselFadeExample />
      <CardTemplate />
    </div>
  );
}

export default App;
